import React, { useEffect, useState } from 'react';
import { Collections } from '../../enums/collections';
import { GetAllDocuments } from '../../helpers/CloudFireStoreHelper';
import CardComponent from '../card/CardComponent';

const BodyComponent = () => {
  const [languajes, setLanguajes] = useState([]);

  const frameworks = [
    {
      id: 1,
      name: '.Net',
      level: 70,
      image:
        'data:image/png;base64,',
    },
    {
      id: 2,
      name: '.Net Core',
      level: 80,
      image:
        'data:image/png;base64,',
    },
    {
      id: 3,
      name: 'Angular 2+',
      level: 90,
      image:
        'data:image/png;base64,',
    },
    {
      id: 4,
      name: 'React.js',
      level: 70,
      image:
        'data:image/png;base64,',
    },
    {
      id: 5,
      name: 'Flutter',
      level: 79,
      image:
        'data:image/png;base64,',
    },
    {
      id: 6,
      name: 'Vue.js',
      level: 75,
      image:
        'data:image/png;base64,',
    },
    {
      id: 7,
      name: 'Bootstrap',
      level: 80,
      image:
        'data:image/jpeg;base64,',
    },
  ];

  useEffect(() => {
    GetAllDocuments(Collections.languajes).then((documents) => {
      setLanguajes(documents);
    });
  }, []);

  return (
    <div className="row mt-3 mb-3 mb-sm-0">
      <div className="col">
        <div className="row justify-content-center">
          <h5>Lenguajes de programacion</h5>
        </div>

        <div className="row">
          {languajes.map((languaje) => (
            <div
              className="col-6 col-md-5 col-lg-4 col-xl-3 mt-3"
              key={languaje.id}
            >
              <CardComponent
                title={languaje.name}
                level={languaje.level}
                imageBase64={languaje.image}
              />
            </div>
          ))}
        </div>
      </div>

      <div className="col-0 col-sm-1 border-left border-right"></div>

      <div className="col mt-5 mt-sm-0">
        <div className="row justify-content-center">
          <h5>Frameworks</h5>
        </div>

        <div className="row">
          {frameworks.map((framework) => (
            <div
              className="col-6 col-md-5 col-lg-4 col-xl-3 mt-3"
              key={framework.id}
            >
              <CardComponent
                title={framework.name}
                imageBase64={framework.image}
              />
            </div>
          ))}
        </div>
      </div>
    </div>
  );
};

export default BodyComponent;
